import React from "react";
import { Row } from "antd";

import { ItemCard } from "./Cards";
import getJeans from "./Products";

function JeansItem() {
  const products = getJeans();

  const handlePay = (id, img, title, price) => {
    alert(`id: ${id}, title: ${title}, price: ${price}`);
  };

  return (
    <div
      className="site-layout-background col-lg-12 p-4"
      style={{
        backgroundColor: "#e3e4e6",
      }}
    >
      <Row gutter={10}>
        {products.map((val, key) => {
          return (
            <ItemCard
              key={val.itemId}
              id={val.itemId}
              img={val.itemImage}
              title={val.itemTitle}
              price={val.itemPrice}
              callback={handlePay}
            />
          );
        })}
      </Row>
    </div>
  );
}

export default JeansItem;
